import React from "react";
import { Container , Row , Col } from "react-bootstrap";

export default function App() {
  return (
    <Container fluid>
      <Row style= {{background: '#222'}}>
        <Col>1 of 2</Col>
      </Row>
      <Row>
        <Col>1 of 3</Col>
        <Col>2 of 3</Col>
        <Col>3 of 3</Col>
      </Row>
    </Container>
  );
}
